import '../App.css';
import ManageUsers from './ManageUsers'
import Movies from './Movies'
import Subscriptions from './Subscriptions'
import Login from './Login'
// import '../App.css'
import '../w3.css'
import {BrowserRouter as Router, Link , Switch, Route, useParams} from 'react-router-dom'
import { useEffect, useState } from 'react';

const Main  = () =>
{
    const {userName} = useParams()
    const [user, setUser] = useState(["userName"])
    // setUser(userName)
    // useEffect(() => {
        console.log("from Main: "+user)
    // }, [])


    return(
        <div>
        <ul class="w3-bar w3-blue">
            <li class="w3-bar-item w3-button tablink"><Link to = "/main/movies" >Movies</Link></li>
            <li class="w3-bar-item w3-button tablink"><Link to = "/main/subscriptions" >Subscriptions</Link></li>
            <li class="w3-bar-item w3-button tablink"><Link to = {{ pathname: `/main/manageUsers/${user}`}} >Users Management</Link></li>
            <li class="w3-bar-item w3-button tablink"><Link to = "/" >Log Out</Link></li>
        </ul>


        <Switch>
            <Route path = "/main/manageUsers/:user" component = {ManageUsers}/>
            <Route path = "/main/movies/:user" component = {Movies}/>
            <Route path = "/main/subscriptions/:user" component = {Subscriptions}/>
        </Switch>

        </div>

    ) 
}

export default Main
